<!doctype html>
<html>

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link href="dist/output.css" rel="stylesheet">
    <title>CoolfreshAgent | Home Page </title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link
        href="https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap"
        rel="stylesheet">
    @vite('resources/css/app.css')
    <!-- Alpine JS CDN -->
    <script defer src="https://unpkg.com/alpinejs@3.x.x/dist/cdn.min.js"></script>

    <!-- Sweet Alert -->
    <script src="https://cdn.jsdelivr.net/npm/sweetalert2@11.10.3/dist/sweetalert2.all.min.js"></script>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/sweetalert2@11.10.3/dist/sweetalert2.min.css">

    <style>

        /* Kustomisasi Pembungkus */
        div:where(.swal2-container) div:where(.swal2-popup) {
            display: none;
            position: relative;
            box-sizing: border-box;
            grid-template-columns: minmax(0, 100%);
            width: 32em;
            max-width: 100%;
            padding: 0 0 1.25em;
            border: none;
            border-radius: 5px;
            color: #545454;
            font-family: inherit;
            font-size: 1rem;
        }

        /* Kustomusisasi Judul */
        .swal2-title{
            color: #033956;
            text-align: center;
            font-family: Poppins;
            font-size: 1.75rem;
            font-style: normal;
            font-weight: 800;
            letter-spacing: 0.06213rem;
        }
        div:where(.swal2-container) .swal2-html-container {
            margin: 0.5rem 1.6em .3em;
        }

        /* Kustomisasi Paragraf Keterangan  */
        div:where(.swal2-container) .swal2-html-container {
            margin-left: auto;
            margin-right: auto;
            width: 55%;
            z-index: 1;
            justify-content: center;
            padding: 0;
            overflow: auto;
            color: #4F4F4F;
            font-size: 0.75rem;
            font-weight: normal;
            line-height: normal;
            text-align: center;
            word-wrap: break-word;
            word-break: break-word;
        }

        /* Kustomisasi Button */
        div:where(.swal2-container) button:where(.swal2-styled).swal2-confirm {
            border: 0;
            border-radius: 0.5rem;
            background: initial;
            background-color: #27AAE1;
            color: #fff;
            font-size: 0.75rem;
            padding-top:1rem;
            padding-bottom:1rem;
            padding-left: 2rem;
            padding-right: 2rem;
        }
        div:where(.swal2-container) div:where(.swal2-actions) {
            display: flex;
            z-index: 1;
            box-sizing: border-box;
            flex-wrap: wrap;
            align-items: center;
            justify-content: center;
            width: auto;
            margin: 1rem auto 0;
            padding: 0;
        }

        /* Kustomissasi Icon */
        div:where(.swal2-icon) {
            position: relative;
            box-sizing: content-box;
            justify-content: center;
            width: 5em;
            height: 5em;
            border: 0.25em solid rgba(0,0,0,0);
            border-radius: 50%;
            border-color: #000;
            font-family: inherit;
            line-height: 5em;
            cursor: default;
            user-select: none;
            margin-top: 2.9em;
            margin-right: auto;
            margin-bottom: 0.6em;
            margin-left: auto;

            /* height: fit-content;
            width: 100%;
            background: #041172; */
        }
    </style>
</head>

